import { VALIDATE_EMAIL } from "../actions/action-types";


const emailErrors = {
    errCount: 0,
    email: null,
}


export default function emailErrorReducer(state = emailErrors, action) {
    switch( action.type ) {
        case VALIDATE_EMAIL: 
            return action.payload 

        default:
            return state;
    }
};
